    createNewMenu = () => {
        fetch(`http://localhost:3000/posts`, {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                post: { week: this.state.date },
